import React, {
    useEffect,
    useRef,
} from 'react';
import {
    BackHandler,
    Platform,
    View,
    Text
} from 'react-native';
import { ActivityIndicator } from 'react-native-paper';
import { WebView } from 'react-native-webview';
import Svg, { Path, Defs, Pattern, Use, Image } from "react-native-svg"
import { Color } from '../components/theme';

export default function Web({ navigation, route }) {

    const webViewRef = useRef(null);
    const onAndroidBackPress = () => {
        if (webViewRef.current) {
            webViewRef.current.goBack();
            return true; // prevent default behavior (exit app)
        }
        return false;
    };

    useEffect(() => {
        if (Platform.OS === 'android') {
            BackHandler.addEventListener('hardwareBackPress', onAndroidBackPress);
            return () => {
                BackHandler.removeEventListener('hardwareBackPress', onAndroidBackPress);
            };
        }
    }, []);

    const Colors = Color()
    function SvgImg() {
        return (
            <Svg
                xmlns="http://www.w3.org/2000/svg"
                xmlnsXlink="http://www.w3.org/1999/xlink"
                width={156}
                height={68}
                fill="none"
            >
                <Path fill="url(#a)" d="M0 0h156v67.045H0z" />
                <Defs>
                    <Pattern
                        id="a"
                        width={1}
                        height={1}
                        patternContentUnits="objectBoundingBox"
                    >
                        <Use xlinkHref="#b" transform="matrix(.0025 0 0 .00582 0 -.663)" />
                    </Pattern>
                    <Image
                        xlinkHref="data:image/png;base64,"
                        id="b"
                        width={400}
                        height={400}
                    />
                </Defs>
            </Svg>
        )
    }
    const Loader = () => (
        <View
            style={{
                flex: 1,
                justifyContent: "center",
                alignItems: "center",
                backgroundColor: Colors.light
            }}
        >
            <Svg
                xmlns="http://www.w3.org/2000/svg"
                xmlnsXlink="http://www.w3.org/1999/xlink"
                width={156}
                height={68}
                fill="none"
            >
                <Path fill="url(#a)" d="M0 0h156v67.045H0z" />
                <Defs>
                    <Pattern
                        id="a"
                        width={1}
                        height={1}
                        patternContentUnits="objectBoundingBox"
                    >
                        <Use xlinkHref="#b" transform="matrix(.0025 0 0 .00582 0 -.663)" />
                    </Pattern>
                    <Image
                        xlinkHref="data:image/png;base64,"
                        id="b"
                        width={400}
                        height={400}
                    />
                </Defs>
            </Svg>

        </View>
    )
    return (
        <>
            <WebView
                source={{ uri: 'https://bcs-bethels.netlify.app/' }}
                ref={webViewRef}
                startInLoadingState={true}
                renderLoading={() => (
                    <View
                        style={{
                            flex: 1,
                            justifyContent: "center",
                            alignItems: "center",
                            backgroundColor: Colors.light,
                            height: "100%",
                            position: "absolute",
                            top: 0,
                            width: "100%"
                        }}
                    >
                        <ActivityIndicator color={Colors.primary} />
                        {/* <SvgImg /> */}
                        <Text style={{ color: Colors.primary, fontSize: 20,marginTop:10 }} >Product of ABAS Rivers State</Text>
                    </View>
                )}
            />
        </>
    )
} 